%spark.r
visDist <- matrix(, nrow =10, ncol =10)
distDf <- (data.frame(MMD@DISTs))[96,]
print(distDf)
for(i in  c(0:9)){
    for(j in c(0:9)){
        if (i==j){
            val <- 0
        } else if (i<j){
            idx <- paste("MMD.mod",i,".vs.mod",j,sep="")
            print(idx)
            val <- distDf[[idx]]
        } else {
            val <- visDist[j+1,i+1]
        }
        visDist[i+1,j+1] <- val
    }
}
